function generateCert(title,author,date,blocknum,txhash){
	var cert = document.createElement("canvas");
	cert.width = 500;
	cert.height = 706;
	var ctx = cert.getContext("2d");
	var image = new Image();
	image.src = "data:image/png;base64,";
	image.onload = function(){
		ctx.drawImage(image,0,0,500,706);
		ctx.font = "15px 黑体";
		ctx.fillStyle = "#410000";
		ctx.fillText(title,180,340);
		ctx.fillText(author,180,383);
		ctx.fillText(date,180,428);
		ctx.fillText(blocknum,220,470);
		ctx.font = "15px 黑体";
		ctx.fillText(txhash.slice(0,18)+'...',235,516);
		var img = document.createElement("img");
		img.src = cert.toDataURL();
		img.style.width = "90%";
		img.style.top = "50px";
		img.style.left = "5%";
		img.style.zIndex = 1000;
		img.style.position = "absolute";
		document.body.appendChild(img);
	}
}